CREATE TABLE `emp_attendance` (
  `attendance_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `date` date NOT NULL,
  `time_in` time DEFAULT '00:00:00',
  `time_out` time NOT NULL DEFAULT '00:00:00',
